import React, { Component } from "react";
import Carousel from "@brainhubeu/react-carousel";
import "@brainhubeu/react-carousel/lib/style.css";

export default class MyCarousel extends Component {
  render() {
    return (
      <Carousel>
        <img src="https://images.unsplash.com/photo-1583073600538-f219abfb20bc?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=668&q=80" />
        <img src="https://images.unsplash.com/photo-1583042014366-43142ce1471d?ixlib=rb-1.2.1&auto=format&fit=crop&w=668&q=80" />
        <img src="https://images.unsplash.com/photo-1582701946020-7d0c7ac8c081?ixlib=rb-1.2.1&auto=format&fit=crop&w=668&q=80" />
      </Carousel>
    );
  }
}
